                return (
                    <tr>
                        <th>
                            {product.code}
                        </th>
                        <th>
                            {product.name}
                        </th>
                        <th>
                            {product.description}
                        </th>
                        <th>
                            <Link exact to={'/updateproduct/' + product.code} key={product.code}> Update
